import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Celebi from './Celebi';
import './index.css';
import { AppProvider } from './context/AppContext';
import { PageProvider } from './context/PageContext';

ReactDOM.render(
  <React.StrictMode>
    <AppProvider>
      <PageProvider>
        <Celebi />
      </PageProvider>
    </AppProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
